import React from 'react';
import web from '../image/to.jpeg';

import LinkPage from './LinkPage';


function About() {
    return (
        <>
         <LinkPage 
         name='Welcome to About page' 
         imgsrc={web} visit= '/contact' 
         btname='Contact Now' />
        </>
    );

};

export default About;
